INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_cb_cardHeadline`, `field_cb_cardBody`, `field_page_uri`, `field_cb_imageLocation`, `field_cb_paragraph`, `field_cb_button`, `field_cb_headline`, `field_page_themeColor`, `field_page_sideNavigation`, `field_cb_buttonStyle`, `field_cb_subhead`, `field_cb_sectionBackgroundColor`, `field_cb_sectionPaddingTop`, `field_cb_sectionPaddingBottom`, `field_cb_sectionTitle`, `field_cb_assetWidth`, `field_cb_deviceHeadline`, `field_cb_deviceBody`, `field_ss_eyebrow`, `field_ss_storyCardColor`, `field_ss_companyName`, `field_ss_storySummary`, `field_cb_buttonColor`, `field_cb_tabLabel`, `field_cb_tabDescription`, `field_cb_timeCode`, `field_cb_descriptionLabel`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, 'left', NULL, NULL, NULL, NULL, '0', NULL, NULL, 'white', 'normal', 'normal', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, 'white', NULL, NULL, '0.0', NULL, '2017-07-20 17:27:58', '2017-07-28 21:23:12', 'cb2d6955-b22a-4e41-b9f8-fe1801657cba'),
 ('2', '2', 'en_us', 'Welcome to Snapchat.craft.dev!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Snapchat.craft.dev will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, 'left', NULL, NULL, NULL, NULL, '0', NULL, NULL, 'white', 'normal', 'normal', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, 'white', NULL, NULL, '0.0', NULL, '2017-07-20 17:27:59', '2017-07-20 17:27:59', 'a82822e3-a162-4074-bfd1-aa965383e384'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Snapchat.craft.dev. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, 'left', NULL, NULL, NULL, NULL, '0', NULL, NULL, 'white', 'normal', 'normal', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, 'white', NULL, NULL, '0.0', NULL, '2017-07-20 17:27:59', '2017-07-20 21:26:43', '8ac7d520-a5e0-4243-9c21-17c47ddbe76b'),
